import "./App.css";

function App() {
  return (
    <div className="app-container">
      <div class="card register--container" style="width: 64rem;">
        <div class="card-body">
          <div class="form-group">
            <label for="exampleFormControlInput1">Email address</label>
            <input
              type="email"
              class="form-control"
              id="exampleFormControlInput1"
              placeholder="name@example.com"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
